export interface OrderState {
    orderItem: any[],
    orderPrice: number,
    orderCurrency: string,
}

export enum OrderActionTypes {
    ADD_TO_ORDER = "ADD_TO_ORDER",
    DELETE_FROM_ORDER = "DELETE_FROM_ORDER",
    CHECKOUT_ORDER = "CHECKOUT_ORDER",
}

interface addToOrderAction {
    type: OrderActionTypes.ADD_TO_ORDER,
    payload: any[],
}

interface deleteFromOrderAction {
    type: OrderActionTypes.DELETE_FROM_ORDER,
    payload: any[],
}

interface chekoutOrderAction {
    type: OrderActionTypes.CHECKOUT_ORDER,
}

export type OrderActions =
    addToOrderAction |
    deleteFromOrderAction |
    chekoutOrderAction
